int
uflagsW(int code)
{ int cp = (unsigned)code / 256;

  if ( cp < UNICODE_MAP_SIZE )
  { const char *s = uflags_map[cp];
    if ( s < (const char *)256 )
      return (int)(intptr_t)s;
    return s[code&0xff];
  }
  return 0;
}

